import * as ROUTES from './constants/routes';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import {Home} from "./pages"

function App() {
  return (
    <Router>
      <Route exact path="/user">
        <h1>I am a user</h1>
      </Route>
      <Route exact path={ROUTES.HOME}>
        {/* <Home/> */}
        h1'
      </Route>
    </Router>
  );
}

export default App;
